import React from 'react';
import Logo from '../../assets/img/Gatonetiflix.png'
import './Menu.css'
function Menu(){
    return(
        <nav ClassName="Menu">
            <a href="/"> 
            <img ClassName="Logo" src ={Logo} alt= "gatonetflix logo"/>
            </a>
        </nav>
    );
}

 export default Menu;
